import { Route } from "react-router-dom/cjs/react-router-dom.min";
import Auth from "./pages/Auth";
import Home from "./pages/Home";

function App() {
  return (
    <>
      <Route path="/">
        <Auth></Auth>
      </Route>
      <Route path="/home" exact>
        <Home></Home>
      </Route>
    </>
  );
}

export default App;
